import React from 'react'
import './Menu.css';
import { Link } from 'react-router-dom';
import MenuLogo from './logo.png'

function Menu() {
    return (
        <div>
            <div className="Menu">
                <div className="MenuIcon">
                <img src= {MenuLogo} alt= 'icon' width = "50px" height = "50px"/>
                </div>
                <h1>SFPOPOS</h1>
                <div className="Menu-Subtitle">San Franciscos Privately Owned Public Spaces</div>
            </div>
        </div>
    )
}

export default Menu
